defs.script:
var cursorTimer;var downOnLink=false;var downOnRoot=false;function islink(tg){return (tg.tagName=='a') ? true : tg.parentNode ? islink(tg.parentNode) : false;};function ismmedia(tg){return (tg.tagName=='video'||tg.tagName=='audio') ? true : tg.parentNode ? ismmedia(tg.parentNode) : false;};document.addEventListener('mousemove', function(e){if(islink(e.target)||e.target.getAttribute('class')=='annot'&&!e.target.id){e.target.style.cursor='pointer';}else{
e.target.style.cursor='url(data:image/png;base64,), auto';
}try{clearTimeout(cursorTimer);}catch(err){};cursorTimer=setTimeout(function(){e.target.style.cursor='none';},3000);});window.addEventListener('contextmenu', function(e){if(!islink(e.target)&&!ismmedia(e.target)) e.preventDefault();});document.addEventListener('mousedown', function(e){if(islink(e.target)||ismmedia(e.target)) downOnLink=true;else downOnRoot=true;});document.addEventListener('mouseup', function(e){if(downOnLink||!downOnRoot){downOnLink=false;return;}downOnRoot=false;if(!e.shiftKey&&e.button==0) document.location.replace('talk-03.svg');if(e.shiftKey||e.button>1) document.location.replace('talk-01.svg');});document.addEventListener('wheel', function(e){if(e.deltaY>0){document.location.replace('talk-03.svg');}if(e.deltaY<0){document.location.replace('talk-01.svg');}});document.addEventListener('keydown',function(e){if(e.key=='PageDown'||e.key=='ArrowDown'||e.key=='ArrowRight')document.location.replace('talk-03.svg');if(e.key=='PageUp'||e.key=='ArrowUp'||e.key=='ArrowLeft')document.location.replace('talk-01.svg');if(e.key=='Home') document.location.replace('talk-01.svg');if(e.key=='End') document.location.replace('talk-15.svg');});function randomMove(tg,s) { let dx=-s+Math.floor(Math.random()*2*s+1); let dy=Math.floor(Math.sqrt(s*s-dx*dx))*(Math.random()<0.5?-1:1); let x,y;x=y=0; if(tg.getAttribute('transform')) { [,x,y]=tg.getAttribute('transform').match(/translate.([^,]+),([^)]+)./); x=Number(x);y=Number(y); } x+=dx;y+=dy; tg.setAttribute('transform','translate('+x+','+y+')'); }
